import React from 'react';
import LayoutFour from "../../components/Layout/LayoutFour";
import { Breadcrumb, BreadcrumbItem } from "../../components/Other/Breadcrumb";

const registerCategory = () => {
    return (
<LayoutFour title="INICIO" className="-style-1">
<Breadcrumb title="ADMINISTRACIÃ“N">
<BreadcrumbItem name="ADMINISTRACION" />
<BreadcrumbItem name="REGISTRO DE SERVICIOS" current />
</Breadcrumb>

            <style>
                {`
                    .login-page {
                        width: 360px;
                        margin: auto;
                        padding-bottom: 60px;
                    }

                    .login-form input, .login-form select {
                        font-family: "Roboto", sans-serif;
                        outline: 0;
                        background: #f2f2f2;
                        width: 100%;
                        border: 0;
                        margin: 0 0 15px;
                        padding: 15px;
                        box-sizing: border-box;
                        font-size: 14px;
                    }

                    .login-form button {
                        font-family: "Roboto", sans-serif;
                        text-transform: uppercase;
                        outline: 0;
                        background: #f26460;
                        width: 100%;
                        border: 0;
                        padding: 15px;
                        color: #FFFFFF;
                        font-size: 14px;
                        -webkit-transition: all 0.3 ease;
                        transition: all 0.3 ease;
                        cursor: pointer;
                    }

                    .login-form button:hover,.login-form button:active,.login-form button:focus {
                        background: #ee3631;
                    }

                    .login-form label {
                        font-family: "Roboto", sans-serif;
                        font-size: 14px;
                        color: #333;
                        margin-bottom: 5px;
                        display: block;
                    }

                    .login-form .form-control-file {
                        border: 1px solid #f2f2f2;
                        padding: 5px;
                    }
                `}
</style>

            <div className="login-page">
<h2>Formulario de Servicios</h2>
<div className="form">
<form className="login-form">
<div className="form-group">
<label htmlFor="serviceName">Nombre del Servicio</label>
<input type="text" id="serviceName" placeholder="Ingrese el nombre del servicio" />
</div>
<div className="form-group">
<label htmlFor="videoSrc">videoSrc</label>
<input type="text" id="videoSrc" placeholder="URL del video" />
</div>
<div className="form-group">
<label htmlFor="description">Descripcion</label>
<input type="text" id="description" placeholder="DescripciÃ³n del servicio" />
</div>
<div className="form-group">
<label htmlFor="serviceImage">Imagen del Servicio 300x300</label>
<input type="file" id="serviceImage" className="form-control-file" />
</div>

                        <button type="submit" className="bold-text">Enviar</button>
</form>
</div>
</div>
</LayoutFour>
    );
};

export default registerCategory;
